const SalesAndPurchasesTable = ({ data, title }) => {
    const columnTitle = title === "Vydane" ? "Dodavatel": "Odberatel";
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-6 offset-md-9">
            <h2>{title} faktury</h2>
            {Array.isArray(data) && data.length > 0 ? (
              <div className="table-responsive">
                <table className="table table-bordered">
                  <thead>
                    <tr>
                      <th>Cislo faktury</th>
                      <th>{columnTitle} </th>
                      <th>Cena</th>
                      <th>Datum vystaveni</th>
                      <th>Datum splatnosti</th>
                    </tr>
                  </thead>
                  <tbody>
                    {data.map(item => (
                      <tr key={item.invoiceNumber}>
                        <td>{item.invoiceNumber}</td>
                        <td>{item.buyer.name}</td>
                        <td>{item.price}</td>
                        <td>{new Date(item.issued).toLocaleDateString()}</td>
                        <td>{new Date(item.dueDate).toLocaleDateString()}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            ) : (
              <p>Žádná data nejsou k dispozici</p>
            )}
          </div>
        </div>
      </div>
    );
  };
  
  export default SalesAndPurchasesTable;
